  true,\n\t\"url\": null,\n\t\"notes\": \"<p>These public use files contain formulary,
  pharmacy network, and pricing data for Medicare Prescription Drug Plans and Medicare
  Advantage Prescription Drug Plans (with the exception of employer and PACE plans).
  The Formulary and Pharmacy Network File will be updated monthly with updates being
  available at the end of the first complete week of each month. Additionally, a file
  containing formulary, pharmacy network, and pricing data will be available on a
  quarterly basis.</p>n\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
